import React, { useState } from 'react';

// 1. Notice the "{ onNavigate }" inside the brackets below?
// This is the "remote control" we receive from App.js
function StudentHome({ onNavigate, onViewProject }) {
  const [searchTerm, setSearchTerm] = useState('');

  // Mock Data
  const projects = [
    { id: 1, title: 'Cosmic Voyager', category: 'Game', author: 'Alex Chen', views: 124, color: 'from-blue-400 to-indigo-500', icon: 'üöÄ' },
    { id: 2, title: 'Campus Map Gen', category: 'Utility', author: 'Sarah Smith', views: 98, color: 'from-emerald-400 to-teal-500', icon: 'üó∫Ô∏è' },
    { id: 3, title: 'NeuroNet AI', category: 'AI', author: 'Raj Patel', views: 215, color: 'from-purple-400 to-pink-500', icon: 'üß†' },
    { id: 4, title: 'Task Flow', category: 'Productivity', author: 'Emily Davis', views: 45, color: 'from-orange-400 to-red-500', icon: '‚úÖ' },
    { id: 5, title: 'Vibe Check', category: 'Social', author: 'Mike Ross', views: 330, color: 'from-yellow-400 to-orange-500', icon: 'üéµ' },
  ];

  const filteredProjects = projects.filter(p => 
    p.title.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-900 via-purple-900 to-blue-900 text-white pb-20">
      
      {/* NAVBAR */}
      <nav className="sticky top-0 z-50 bg-white/10 backdrop-blur-md border-b border-white/10 px-6 py-4 flex justify-between items-center">
        <h1 className="text-2xl font-bold tracking-tight">CampusCanvas</h1>
        
        {/* Search Bar */}
        <div className="hidden md:flex bg-black/20 rounded-full px-4 py-2 border border-white/10 w-96">
          <span className="mr-2">üîç</span>
          <input 
            type="text" 
            placeholder="Search projects..." 
            className="bg-transparent outline-none w-full text-sm placeholder-white/50"
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </div>

        <div className="flex items-center gap-4">
          {/* 2. THE PLUS BUTTON */}
          {/* When clicked, it uses the remote control to switch to 'add-project' */}
          <button 
            onClick={() => onNavigate('add-project')}
            className="w-10 h-10 rounded-full bg-blue-500 flex items-center justify-center font-bold hover:bg-blue-400 transition shadow-lg shadow-blue-500/50 text-white text-2xl pb-1"
            title="Add New Project"
          >
            +
          </button>
          
          <div className="w-10 h-10 rounded-full bg-gradient-to-r from-pink-500 to-purple-500 flex items-center justify-center font-bold cursor-pointer">
            JD
          </div>
        </div>
      </nav>

      {/* HERO SECTION */}
      <div className="max-w-7xl mx-auto mt-10 px-6">
        <div className="relative overflow-hidden rounded-3xl bg-gradient-to-r from-violet-600 to-indigo-600 p-8 md:p-12 shadow-2xl border border-white/20">
          <div className="absolute top-0 right-0 -mr-20 -mt-20 w-80 h-80 bg-white/10 rounded-full blur-3xl"></div>
          
          <div className="relative z-10 max-w-2xl">
            <span className="bg-white/20 px-3 py-1 rounded-full text-xs font-semibold uppercase tracking-wider mb-4 inline-block">Featured Project</span>
            <h2 className="text-4xl md:text-5xl font-bold mb-4">Cosmic Voyager</h2>
            <p className="text-lg text-blue-100 mb-8">An endless space exploration game with procedural generation. Fly, trade, and survive in a hostile galaxy.</p>
            <button className="bg-white text-indigo-900 px-8 py-3 rounded-full font-bold hover:bg-blue-50 transition shadow-lg hover:scale-105 active:scale-95">
              Launch Project üöÄ
            </button>
          </div>
        </div>
      </div>

      {/* GRID */}
      <div className="max-w-7xl mx-auto mt-12 px-6">
        <h3 className="text-2xl font-bold mb-6 flex items-center">üî• Trending Now</h3>
        
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {filteredProjects.map((project) => (
            <div key={project.id} className="group bg-white/5 backdrop-blur-lg border border-white/10 rounded-2xl p-5 hover:bg-white/10 transition cursor-pointer">
              <div className={`h-32 rounded-xl bg-gradient-to-br ${project.color} flex items-center justify-center text-6xl shadow-inner mb-4 group-hover:scale-105 transition duration-300`}>
                {project.icon}
              </div>
              <h4 className="text-xl font-bold truncate">{project.title}</h4>
              <p className="text-sm text-white/60 mb-4">{project.category} ‚Ä¢ by {project.author}</p>
              <div className="flex justify-between items-center border-t border-white/10 pt-4">
                <span className="text-xs bg-white/10 px-2 py-1 rounded">üëÄ {project.views}</span>
                <button className="text-sm font-bold text-blue-300 hover:text-white transition">View ‚ûú</button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default StudentHome;
